public Optional<OffsetDateTime> getExpirationDateTime() {
  return expiration == 0
      ? Optional.empty()
      : Optional.of(
          OffsetDateTime.ofInstant(
              new Date(expiration).toInstant(),
              ZoneOffset.UTC));
}
